import React from 'react';
import './About.css';

const About: React.FC = () => {
  return (
    <div className="about-container">
      <h1>About Us</h1>
      <p>Our mission is to provide free, high-quality educational resources to students everywhere.</p>
      <p>We believe that education is a fundamental right and should be accessible to all, regardless of their background or financial situation. Our platform is built by a community of educators and developers who are passionate about making a difference in the world.</p>
    </div>
  );
};

export default About;
